aipAPI.prototype.checkBidders = function() {
	var aRemoveBidders = [];

	//exclude bidders from country
	var excludeBidders = {
		'pubmatic': ['RU', 'UA', 'BY', 'RS', 'VE', 'LB', 'BA', 'MK', 'AL', 'IQ', 'ZW', 'ME', 'TM', 'PF', 'TJ', 'LY', 'SO', 'GP', 'AX', 'YE', 'AD', 'CD', 'MC', 'GA'],
		'rhythmone': ['TR', 'ID', 'VN', 'EG']
	};
	for (const key in excludeBidders) {
		if(aipAPItag.inArray(this.CountryCode, excludeBidders[key])!= -1){
			aRemoveBidders.push(key);
			aipAPItag.log("Removing bidder "+key+" from all AdUnits because user is from: "+this.CountryCode);
		}
	}

	//include bidder in countries only
	var includeBidders = {
		'sonobi': ['US', 'CA', 'MX']
	};
	for (const key in includeBidders) {
		if(aipAPItag.inArray(this.CountryCode, includeBidders[key])== -1){
			aRemoveBidders.push(key);
			aipAPItag.log("Removing bidder "+key+" from all AdUnits because user is from: "+this.CountryCode);
		}
	}
	
	//remove rubicon when in iframe
	if(this.inIframe()) {
		aRemoveBidders.push("rubicon");
		aipAPItag.log("Removing bidder rubicon from all AdUnits because in iframe");
	}
	
	//remove bidders from specific hosts
	try {
		const excludeBiddersFromHosts = {
			'eggboy.club': ['sharethrough']
		}
		if(excludeBiddersFromHosts[window.location.hostname]) {
			for (const value of excludeBiddersFromHosts[window.location.hostname]) {
				aRemoveBidders.push(value);
				aipAPItag.log("Removing bidder "+value+" from all AdUnits because hostname is: "+window.location.hostname);
			}
		}
	} catch (e) {}

	//removeBidders
	if(aRemoveBidders.length > 0) {
		//removeBidders from display
					this.removeBidders(this.adUnits['hexanaut-io_728x90'], aRemoveBidders);
					this.removeBidders(this.adUnits['hexanaut-io_728x90_2'], aRemoveBidders);
					this.removeBidders(this.adUnits['hexanaut-io_300x600'], aRemoveBidders);
					this.removeBidders(this.adUnits['hexanaut-io_300x600_2'], aRemoveBidders);
					this.removeBidders(this.adUnits['hexanaut-io_300x250'], aRemoveBidders);
					this.removeBidders(this.adUnits['hexanaut-io_300x250_2'], aRemoveBidders);
		
		//removeBidders from preroll
						this.removeBidders([this.videoAdUnit["hexanaut.io_preroll"]], aRemoveBidders);
					}
}

